<div class="w-full items-center justify-center flex flex-col">
    @vite(['resources/css/app.css', 'resources/js/app.js'])



    <div>
        <label for="state">Select State:</label>
        <select wire:model="selectedState" id="state" >
            <option value="">-- Select State --</option>
            @foreach($svgData as $state => $cities)
                <option value="{{ $state }}">{{ $state }}</option>
            @endforeach
        </select>
    </div>

    @if($selectedState)
        <div>
            <label for="city">Select City:</label>
            <select wire:model="selectedCity" id="city">
                <option value="">-- Select City --</option>
                @foreach($cities as $city)
                {{-- {{dd($city)}} --}}
                    <option value="{{ $city }}">{{ $city }}</option>
                @endforeach
            </select>
        </div>

        @if($selectedCity && isset($svgData[$selectedState]['city'][$selectedCity]))
            <!-- Display the SVG data for the selected city -->
            <svg width="100" height="100">
                <path d="{{ $svgData[$selectedState]['city'][$selectedCity]['d'] }}" fill="blue" />
                <!-- Add other SVG elements here if needed -->
            </svg>
        @endif
    @endif



        <button wire:click="toggleSvg" class="px-6 py-2 bg-red-400 text-white shadow-md mt-10" >Increment</button>
        
